import'bootstrap/dist/css/bootstrap.min.css';

import React,{} from 'react';
import Sesion from './components/Sesion';
import Menu from './components/Menu';


function App(){

    let usuario =  JSON.parse(sessionStorage.getItem('usuarioActivo'));
 
    return(
       usuario ? <Menu/> : <Sesion/>
    );
}

export default App;
